import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Cashier from './Cashier'; // Ganti dengan path yang sesuai
import Manager from './Manager'; // Contoh komponen lain
import Admin from './Admin'; // Contoh komponen lain
import Sidebar from './Sidebar'; // Pastikan path sidebar benar

const App = () => {
  return (
    <Router>
      <div className="flex">
        <Sidebar username="KasirUser" role="kasir" /> {/* Ganti sesuai dengan role dan username yang sesuai */}
        <div className="flex-1">
          <Routes>
            <Route path="/cashier" element={<Cashier />} />
            <Route path="/manager" element={<Manager />} />
            <Route path="/admin" element={<Admin />} />
            {/* Tambahkan route lain di sini */}
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
